import React, { useState, useEffect } from 'react';
import './myworks.css';
import { Link } from 'react-router-dom';
import axios from 'axios';

export const Myworks = () => {
    const [acceptedNotifications, setAcceptedNotifications] = useState([]);

    useEffect(() => {
        const fetchNotifications = async () => {
            try {
                const response = await axios.get('http://localhost:5000/myworks');
                const notifications = response.data;
                setAcceptedNotifications(notifications);
            } catch (error) {
                console.error('Error fetching notifications:', error);
            }
        };

        fetchNotifications();
    }, []);

    return (
        <>
            <nav className="navbar">
                <div className="logo">
                    <h1 style={{ fontFamily: "Courier New', Courier, monospace", fontSize: '27px' }}>
                        SkillBridge
                    </h1>
                </div>
                <div className="nav-right">
                    <ul className="nav-links">
                        <li><Link to="/Home">Home</Link></li>
                        <li><Link to="/videos">Videos</Link></li>
                        <li><Link to="/mywo">My Works</Link></li>
                        <li><Link to="/notifications">Notifications</Link></li>
                    </ul>
                    <div className="profile">
                        <img
                            src="https://cdn.pixabay.com/photo/2015/10/05/22/37/blank-profile-picture-973460_960_720.png"
                            alt="Profile"
                            className="profile-img"
                        />
                    </div>
                </div>
            </nav>
            <div className='myworks-container'>
                <h1>My Works</h1>
                <div className="works-list">
                    {acceptedNotifications.length > 0 ? (
                        acceptedNotifications.map((notification) => (
                            <div key={notification._id} className="work-item">
                                <h2>{notification.serviceName}</h2>
                                {/* Display more details about the work */}
                                <p>{notification.details}</p>
                            </div>
                        ))
                    ) : (
                        <p>No accepted notifications available.</p>
                    )}
                </div>
            </div>
        </>
    );
}
